;; gorilla-repl.fileformat = 1

;; **
;;; # 3CNFSAT
;;; 
;;; In probabilistic programming systems like Anglican one may easily write programs that intentionally or unintentionally result in inference problems that are arbitrarily hard.  
;;; 
;;; From Wikipedia "Like the satisfiability problem for arbitrary formulas, determining the satisfiability of a formula in conjunctive normal form where each clause is limited to at most three literals is NP-complete also..."
;;; 
;;; A programmer can easily write a program which corresponds to 3CNFSAT solving.  In fact we can pose SAT solving as inference.
;;; 
;;; This suggests that general purpose inference is hard.  
;; **

;; @@
(ns satisfiability
  (:require [gorilla-plot.core :as plot])
  (:use clojure.repl
        [mrepl core]
        [embang runtime emit]
        [clojure.string :only (join split blank?)]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Again we'll make use of the Dirac distribution.
;; **

;; @@
(defdist dirac
  "Dirac distribution"
  [x] []
      (sample [this] x)
      (observe [this value] (if (= x value) 0.0 (- (/ 1.0 0.0)))))

(defn satisfiable-conjunction [state] 
  (let [v (fn [i] (nth state i))]
       (and ;(or (v 0) (v 1) (v 2)) 
            (or (v 0) (v 1) (not (v 2)))
            (or (v 0) (not (v 1)) (v 2)) 
            (or (v 0) (not (v 1)) (not (v 2)))
            (or (not (v 0)) (v 1) (v 2)) 
            (or (not (v 0)) (v 1) (not (v 2)))
            (or (not (v 0)) (not (v 1)) (v 2)) 
            (or (not (v 0)) (not (v 1)) (not (v 2))))))

(defn unsatisfiable-conjunction [state] 
  (let [v (fn [i] (nth state i))]
       (and (or (v 0) (v 1) (v 2)) 
            (or (v 0) (v 1) (not (v 2)))
            (or (v 0) (not (v 1)) (v 2)) 
            (or (v 0) (not (v 1)) (not (v 2)))
            (or (not (v 0)) (v 1) (v 2)) 
            (or (not (v 0)) (v 1) (not (v 2)))
            (or (not (v 0)) (not (v 1)) (v 2)) 
            (or (not (v 0)) (not (v 1)) (not (v 2))))))

(def N 3)

(with-primitive-procedures [dirac conjunction] 
  (defquery Three-CNF-SAT [N] 
    (let [state (repeatedly N (fn [] (sample (flip 0.5))))]
    (observe (dirac true) (conjunction state))
   (predict :state state))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;satisfiability/Three-CNF-SAT</span>","value":"#'satisfiability/Three-CNF-SAT"}
;; <=

;; **
;;; We can check that these generators produce sample distributions that are in accordance with our understanding of Geometric which they are.
;; **

;; @@

(->> (doquery :pcascade Three-CNF-SAT [3] :debug true)
     (take 1000)
     (map get-predicts)
     (map :state)
     (map conjunction)
     )
